import createReactComponent from '../createReactComponent';
var MinusSquare = createReactComponent('MinusSquare', [['rect', {
  x: '3',
  y: '3',
  width: '18',
  height: '18',
  rx: '2',
  ry: '2',
  key: 'maln0c'
}], ['line', {
  x1: '8',
  y1: '12',
  x2: '16',
  y2: '12',
  key: '1myapg'
}]]);
export default MinusSquare;
